import React from 'react';
import Layout from "../../_layouts/default/Layout";
import {useStyles} from "./NotFound.style";


const NotFound = () => {
    const classes = useStyles()

    return (
        <Layout>
            <div className={classes.root}>
                <div id="clouds">
                    <div className={`${classes.cloud} x1`}/>
                    <div className={`${classes.cloud} x1_5`}/>
                    <div className={`${classes.cloud} x2`}/>
                    <div className={`${classes.cloud} x3`}/>
                    <div className={`${classes.cloud} x4`}/>
                    <div className={`${classes.cloud} x5`}/>
                </div>
                <div className={classes.c}>
                    <div className={classes._404}>404</div>
                    <hr className={classes.hr} />
                    <div className={classes._1}>THE PAGE</div>
                    <div className={classes._2}>WAS NOT FOUND</div>
                    <a className={classes.btn} href='/'>BACK TO MARS</a>
                </div>
            </div>
        </Layout>
    );
}

export default NotFound
